export default function Bet(props){
    return(
        <div className="container text-centre my-5">
            <h1 className="my-3">Bet Details</h1>
            <h4 className="my-3">CSK vs RCB</h4>
            <h4 className="my-3">1.8 vs 2.0</h4>
            <div class="input-group mb-3">
                <span class="input-group-text" id="basic-addon1">Your Predicted Winner</span>
                <input type="text" class="form-control" placeholder="Team Name" aria-label="Team Name" aria-describedby="basic-addon1"/>
            </div>
            <button class="btn btn-primary" type="submit">Predict</button>
        </div>
    )
}
